(def nabdir "../NAB/")

(defn ts-data [file-id] (nab-io/read-nab-ts-by-id nabdir file-id))

(def anomaly-windows
  (nab-io/read-anomaly-windows nabdir))

(->>
  anomaly-windows
  (map (fn [[k wins]] [k (count wins)]))
  (sort))
