(defn ts-anom-data
  ([file-id anom-i pad]
   (ts-anom-data (ts-data file-id) file-id anom-i pad))
  ([ts file-id anom-i pad]
   (when-let [win (get-in anomaly-windows [file-id anom-i])]
     (let [[start end*] win
           end (if pad (t/plus end* pad) end*)]
       (->> ts
            (drop-while #(t/before? (:timestamp %) start))
            (take-while #(not (t/after? (:timestamp %) end))))))))
