(def hour-encoder
  (e/sampling-linear-encoder [54] 21 [0 24] 9.5 true))

(def day-of-week-encoder
  (e/sampling-linear-encoder [41] 10 [0 7] 4 true))

(defn make-val-encoder
  [lower upper]
  (let [span (- upper lower)
        radius (/ span 4)]
    (e/sampling-linear-encoder [400] 41 [(- lower radius) (+ upper radius)]
                               radius)))

