(defn detection-plot
  ([file-id anomaly-ts threshold]
   (detection-plot file-id anomaly-ts threshold :anomaly))
  ([file-id anomaly-ts threshold anomaly-key]
   (let [ts anomaly-ts
         win-plot (anomaly-window-plot ts file-id 1.0)]
     (plot/compose
      (ts-plot (map #(assoc % :value (get % anomaly-key)) ts))
      (plot/list-plot (map (juxt :index anomaly-key)
                           (filter #(>= (get % anomaly-key 0) threshold)
                                   ts)))
      win-plot))))
