;; @@
(time
(def timeline
  (let [ts (ts-data flatmid)
        lower (dec (apply min (map :value ts)))
        upper (inc (apply max (map :value ts)))
        encoder (make-val-encoder lower upper)
        htm (make-model encoder)]
    (doall
      (reductions p/htm-step htm (take 530 ts))))
  )
)

